import React, { Component, useState, setState, componentDidMount } from "react";

import Node from "./Node/Node";

export default class PathfindingVisualizer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nodes: [],
    };
  }
  componentDidMount() {
    const nodes = [];
    for (let row = 0; row < 15; row++) {
      const currentRow = [];
      for (let col = 0; col < 50; col) {
        currentRow.push([]);
      }
      nodes.push(currentRow);
    }
    this.setStates({ nodes });
  }
  render() {
    const { nodes } = this.state;
    console.log(nodes);

    return (
      <div className="gird">
        {nodes.map((row, rowIdx) => {
          return (
            <div>
              {row.map((node, nodeIdx) => (
                <Node></Node>
              ))}
            </div>
          );
        })}
      </div>
    );
  }
}

